// App.js
// Entry point for the frontend. Sets up routing between pages and
// includes the NavBar and Footer on all pages. Uses react‑router‐dom for
// client side routing. Style imports are consolidated here.

import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NavBar from './components/NavBar';
import Footer from './components/Footer';
import Home from './pages/Home';
import Services from './pages/Services';
import About from './pages/About';
import Contact from './pages/Contact';
import Legal from './pages/Legal';
import Payment from './pages/Payment';
// Import detailed service pages
import PhotoPrint from './pages/services/PhotoPrint';
import CopyScan from './pages/services/CopyScan';
import Printing from './pages/services/Printing';
import DesignAdvertising from './pages/services/DesignAdvertising';
import MerchPrint from './pages/services/MerchPrint';
import OnlineDelivery from './pages/services/OnlineDelivery';
// Import dynamic pages for category and individual services. These pages
// build their content from data/servicesData.js and provide scalable
// routing for any number of categories and services.
import CategoryPage from './pages/services/CategoryPage';
import ServicePage from './pages/services/ServicePage';
import './styles.css';

const App = () => {
  return (
    <Router>
      <div className="app-container">
        <NavBar />
        <main className="main-content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/services" element={<Services />} />
          {/* Legacy pages remain accessible, but the new routing uses dynamic category pages. */}
          <Route path="/services/photo-print" element={<PhotoPrint />} />
          <Route path="/services/copy-scan" element={<CopyScan />} />
          <Route path="/services/printing" element={<Printing />} />
          <Route path="/services/design-advertising" element={<DesignAdvertising />} />
          <Route path="/services/merch-print" element={<MerchPrint />} />
          <Route path="/services/online-delivery" element={<OnlineDelivery />} />
          {/* Dynamic routes: category overview and service details */}
          <Route path="/services/:categorySlug" element={<CategoryPage />} />
          <Route path="/services/:categorySlug/:serviceSlug" element={<ServicePage />} />
            <Route path="/about" element={<About />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/legal" element={<Legal />} />
            <Route path="/payment" element={<Payment />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
};

export default App;
